    public long maximumHappinessSum(int[] happiness, int k) {

        if(happiness.length==0){
            return 0;
        }
        Arrays.sort(happiness);
        long maxHappiness = 0;
        int n = happiness.length-1;
        int turns = 0;
        while(n>=0 && k>turns){
            maxHappiness += Math.max(happiness[n]-turns, 0);;
            n--;
            turns++;
        }
        return maxHappiness;
    }
